import "../css/SideNavbar.css";

const SideNav = () => {
  return (
    <>
      <div className="m-banner col-12">
        <div class="sidebar">
          <a class="active" href="#home">
            Home
          </a>
          <a href="#news">News</a>
          <a href="#contact">Contact</a>
          <a href="#about">About</a>
        </div>
      </div>
    </>
  );
};

export default SideNav;
